window.bookSummaryJSON = "<p>After a night of drunken debauchery following the defeat of the academy's headmistress, Lucas awakens to trouble on all fronts. The steady balance of power within the Imperium has been shaken by his presence, and the resulting aftermath is a town full of heavily armed and well-staffed enemies that seek Lucas' death. Lucas must not only survive their assault but also manage his own slowly crumbling internal affairs when his party begins to fracture. Angered by Lucas' increasingly selfish actions, some of his closest allies are tempted to turn against him.</p> <p>Follow our protagonist while he tries to grow his influence within the empire, survive the daggers in his back from Imperium traitors, and restore the relationship he truly wants with the woman he has slowly fallen in love with in this epic litrpg adventure from Charles Dean.</p>"; 
